Apologies for the confusion. Here's the corrected SPARQL query:

```sparql
SELECT ?year, SUM(?totalSeatsPerYear) AS totalSeats
WHERE {
  ?airport a https://schema.coypu.org/global#Airport ;
           https://schema.coypu.org/global#hasId "SKD" ;
           https://schema.coypu.org/global#hasTotalSeatsPerYear ?totalSeatsPerYear .
}
GROUP BY ?year
```

The issue was that the `BIND` statement was not necessary in this case, as the `?year` variable can be directly derived from the data. The corrected query should work as expected.

